DESCRIPTION:
Labai gilios duobės:
1. Prie Lazdynų ligoninės, įvažiavimas į skubios pagalbos skyrių, netoli buvusio &#34;kontrolės posto&#34; namelio (raudonų plytų), gylis apie 20 cm, gal ir daugiau;
2. Prie Jeruzalės g. 17 IKI parduotuvės, ant įvažiavimo į parkavimo aikštelę (pirmas įvažiavimas nuo veterinarijos klinikos pusės), gylis apie 20 cm.

nuolat statomi automobiliai.
150.7. ten, kur tarp sustojusios transporto priemonės ir ištisinės horizontaliojo ženklinimo linijos (bortelio) mažesnis kaip 3 m atstumas;

sukelia avarines situacijas nes dalis pravažiuojančio automobilio išlenda į priešpriešinę eismo juostą o iš už posūkio atvažiuojantis to nesitiki ir nelaukia. Reikėtų ženklo draugiančio sustoti nes į liniją nekreipia dėmesio niekas<br>Pažeidimo data ir laikas: 2021-05-04 20:45<br>Automobilio valst. nr.:[duomenys nuasmeninti]

